  false,\n\t\"url\": null,\n\t\"notes\": \"Using a LH Systems ALS50 Light Detection
  And Ranging (LiDAR) system, standard density (1.4 meter ground sample distance)
  data were collected over areas in Northern Cameron and Willacy Counties, TX (approximately
  1021 square miles). Multiple returns were recorded for each laser pulse along with
  an intensity value for each return. The data are bare earth classified. The data
  acquisition occurred in 36 missions between December 14, 2005 and February 23, 2006.
  The data was collected by Sanborn Mapping Company, Inc. for the Texas Water Development
  Board (TWDB) and the Federal Emergency Management Agency (FEMA).\",\n\t\"license_title\":
